+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="2D67F9044A1E53091FB56C82D02E78DE", NativeString="Still, the quiet dream of Rustler the Pet Vet whispers to me sometimes. I even wrote my own jingle!", LocalizedStrings=(("ar","ومع ذلك، فإن الحلم الهادئ بأن أكون طبيبة بيطرية يهمس لي أحيانًا. حتى أنني كتبت لحن هذا الحلم!"),("en","Still, the quiet dream of being a vet whispers to me sometimes. I even wrote my own jingle!"),("de","Aber dennoch, manchmal träume ich insgeheim immer noch davon, eine Tierärztin zu werden. Ich habe sogar einen eigenen Werbesong geschrieben!"),("es","Aun así, a veces todavía sueño con ser veterinaria. ¡Incluso he escrito una canción promocional!"),("es-419","Aun así, el sueño de dedicarme a la veterinaria a veces me habla. ¡Incluso compuse mi propia canción!"),("fr","Parfois, l'image de la Gardienne de bétail vétérinaire me revient en tête. Je m'étais même composé un thème !"),("it","Anche se, a volte, accarezzo ancora il sogno di diventare veterinaria. Ho anche scritto il mio jingle!"),("ja","今でも、獣医になるっていう密かな夢が時々ささやきかけてくるんだけどね。宣伝文句だって考えたのよ！"),("ko","아직도 수의사가 되라는 마음의 소리가 가끔 들리곤 해요. 심지어 저만의 노래도 썼다니까요!"),("pl","Czasem odzywa się we mnie ciche marzenie o zostaniu weterynarzem. Nawet zrobiłam własny dżingiel!"),("pt-BR","Ainda assim, esse sonho adormecido ainda desperta, vez ou outra. Até escrevi uma música!"),("ru","Однако я до сих пор лелею мечты о титуле зоодоктора. Я даже специальную песенку написала!"),("tr","Yine de veteriner olmanın hayali bazen kulağıma fısıldıyor. Kendime reklam müziği bile yazdım!")))
+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="3DFAC67F4356398DA831A1A788D561F7", NativeString="<emphasis>Otis</> is always happy to help filet some fish! He's good with his hands.", LocalizedStrings=(("ar","يفضل <emphasis>رشيد</> المزرعة على البحيرة، ولكنه يسعد دائمًا بالمساعدة في تقطيع بعض الأسماك!"),("en","<emphasis>Otis</> prefers the farm to the lake, but he's always happy to help sort some fish!"),("de","<emphasis>Otis</> mag die Farm lieber als den See, aber er hilft immer gerne dabei Fische zu sortieren."),("es","<emphasis>Calabacio</> prefiere quedarse en la granja antes que ir al lago, pero siempre está dispuesto a ayudar a separar el pescado."),("es-419","¡<emphasis>Calabacio</> siempre me ayuda a separar el pescado! Es muy hábil con las manos."),("fr","<emphasis>André Colte</> préfère travailler à la ferme, mais il est toujours ravi d'aider quand on ramène du poisson."),("it","<emphasis>Dinello</> preferisce la fattoria al lago, ma ti aiuterà a catalogare i tuoi pesci molto volentieri!"),("ja","<emphasis>オーティス</>は湖より農場を好むけど、いっつも魚を選別するのを手伝ってくれるんだ！"),("ko","<emphasis>오티스</>는 호수보단 농장을 좋아해요. 하지만 언제나 물고기 분류를 즐겁게 도와요!"),("pl","<emphasis>Olaf</> woli farmę niż jezioro, ale zawsze chętnie pomoże przy sortowaniu ryb!"),("pt-BR","O <emphasis>Carlos Campos</> curte mais a fazenda do que o lago, mas sempre fica feliz me ajudando a organizar os peixes!"),("ru","<emphasis>Отис</>, конечно, между фермой и озером выберет первое, но он всегда готов помочь с приготовлением рыбы!"),("tr","<emphasis>Möömati</> benimle göle gelmektense çiftlikte kalmayı tercih ediyor ama her zaman balık ayırmaya memnuniyetle yardımcı oluyor.")))
+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="7454C2834C8D87FD729D7790EA4B6C84", NativeString="Don't leave your <emphasis>Fishing Rods</> lying around. <emphasis>Fishstick</> keeps biting mine.", LocalizedStrings=(("ar","حافظ على الطُعم الخاص بك. لا يتوقف <emphasis>عصا السمكة</> عن أكل الطُعم الخاص بي."),("en","Don't leave your bait lying around. <emphasis>Fishstick</> keeps eating mine."),("de","Lasse deinen <emphasis>Köder</> nicht unbeaufsichtigt rumliegen. <emphasis>Fischstäbchen</> isst ständig meinen auf."),("es","No dejes tu cebo por ahí. Si te despistas, <emphasis>Palito de pescado</> se lo comerá todo."),("es-419","No dejes tus <emphasis>cañas de pescar</> por ahí. <emphasis>Palito de pez</> no deja de morder la mía."),("fr","Ne laissez pas traîner vos appâts. <emphasis>Poiscaille</> n'arrête pas de manger les miens."),("it","Non lasciare in giro le tue esche. <emphasis>Pescesecco</> continua a mangiarsi le mie."),("ja","エサをその辺に置きっぱなしにしちゃいけないよ。自分のやつに<emphasis>フィッシュスティック</>が何回食いついたことか。"),("ko","아무 데나 <emphasis>미끼</>를 두지 마세요. <emphasis>피시스틱</>이 제 걸 자꾸 먹어요."),("pl","Nie zostawiaj <emphasis>przynęty</> byle gdzie. <emphasis>Paluch Rybny</> wciąż zjada moją."),("pt-BR","Não deixe suas iscas sem supervisão. O <emphasis>Peixoto</> tá sempre comendo as minhas."),("ru","Не оставляй наживку без присмотра! <emphasis>Карась</> постоянно клюёт на мою."),("tr","Sakın yemlerini ortalık yerde bırakma. <emphasis>Japon Balığı</> benimkileri yiyip duruyor.")))
+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="234F39994A709D93DAFA6A9A472BB1A7", NativeString="<emphasis>Sunflower's</> been askin' me about startin' up a fish farm together. I don't even know how a fish would drive a tractor.", LocalizedStrings=(("ar","تسأل <emphasis>دوار الشمس</> إذا كان من الممكن تعليم سمكة كيفية قيادة جرار. لا أعرف غرضها من السؤال..."),("en","<emphasis>Sunflower's</> been askin' me if it's possible to teach a fish how to drive a tractor. Not sure what that's about..."),("de","<emphasis>Sonnenblume</> hat mich gefragt, ob man Fischen beibringen kann, einen Traktor zu fahren. Keine Ahnung warum ..."),("es","<emphasis>Girasol</> me ha preguntado si sería posible que un pez condujera un tractor... No he entendido a qué venía, la verdad."),("es-419","<emphasis>Mirasol</> quiere que pongamos en marcha una granja de pescados. Pero no me imagino a un pez manejando un tractor."),("fr","<emphasis>Tournesol</> voulait savoir si les poissons peuvent apprendre à conduire un tracteur. Je ne sais pas ce qu'elle a en tête..."),("it","<emphasis>Girasole</> continua a chiedermi se è possibile insegnare a un pesce come si guida il trattore. Non so cosa stia architettando..."),("ja","<emphasis>サンフラワー</>から魚にトラクターの運転を教えられるかって聞かれてるんだよね。どういうことなのかよくわからないけど..."),("ko","<emphasis>해바라기</>가 자꾸 물고기에게 트랙터 운전을 가르칠 수 있는지 묻네요. 정말 무슨 생각인지 모르겠어요..."),("pl","<emphasis>Słoneczniczka</> wypytywała mnie, czy da się nauczyć rybę jeździć traktorem. Kto wie, co jej chodzi po głowie..."),("pt-BR","A <emphasis>Fazendeira</> já me perguntou várias vezes se é possível ensinar um peixe a dirigir um trator. Não entendi bem o porquê."),("ru","<emphasis>Ромашка</> постоянно спрашивает, можно ли научить рыбу водить трактор. Честно говоря, не понимаю, зачем ей эта информация..."),("tr","<emphasis>Ayçiçeği</> bana balıklara traktör kullanmayı öğretmenin mümkün olup olmadığını sorup duruyor. Neyin peşinde olduğundan emin değilim...")))
+TextReplacements=(Category=Game, Namespace="CosmeticsGatingBlueprintLibrary", bIsMinimalPatch=True, Key="CosmeticOfferPurchaseConfirmationRestrictionJamTrack", NativeString="You will only be able to use them in experiences rated {0} or lower.", LocalizedStrings=(("ar","لن تتمكّن من استخدامها في التجارب التابعة لتصنيف {0} أو أقل."),("en","You will not be able to use them in experiences rated {0} or lower."),("de","Du kannst sie nicht in Erlebnissen mit der ESRB-Einstufung {0} oder niedriger nutzen."),("es","No podrás utilizar estos cosméticos en experiencias con una calificación {0} o inferior."),("es-419","No podrás usar estos objetos en experiencias clasificadas para {0} o inferior."),("fr","Vous ne pourrez vous en servir dans les expériences classées {0} ou inférieur."),("it","NON sono utilizzabili nelle esperienze classificate {0} o inferiore."),("ja","これらは、「{0}」以下のレーティングが設定された体験では使用できません。"),("ko","이제부터는 등급이 {0} 이하인 경험에서는 사용할 수 없습니다."),("pl","Nie będziesz w stanie użyć ich w przygodach z klasyfikacją wiekową {0} lub niższą."),("pt-BR","Você não poderá usá-los em experiências de classificação {0} ou abaixo."),("ru","Вы не сможете использовать их в опытах, рейтинг которых равен {0} или ниже."),("tr","Bunları {0} veya daha düşük dereceye sahip deneyimlerde kullanamayacaksın.")))
