+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="9D6335274047B66E541DE592412F6DFF", NativeString="<text color=\"FFFFFFFF\" fontface=\"black\" size=\"20\" Case=\"AllCaps\">This BluGlonium-fueled inventor has a passion for science.</>\r\n<text color=\"DDC1FFFF\">Fulfill your dashingly scientific process with the Vinderman 2.0 Pack, featuring:</>", LocalizedStrings=(("ko","<text color=\"FFFFFFFF\" fontface=\"black\" size=\"20\" Case=\"AllCaps\">블루글로늄에서 힘을 얻는 이 발명가는 과학에 대한 열정이 어마어마합니다.</>\n<text color=\"DDC1FFFF\">빈더만 2.0 팩으로 근사한 과학적 프로세스를 완성하세요. 구성품:</>")))
